  [],\n\t\"revision_timestamp\": \"2016-08-20T09:39:37.404582\",\n\t\"name\": \"ridgefield-complex-invasive-plant-ed-rr-search\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project is a part of the Gorge
  NWRsu2019 invasives management program and will help achieve goals and improve targeted
  habitats identified in the Refugesu2019 CCP (FWS 2004). This project will expand
  search work started in 2014 and will focus on ED/ for English ivy, holly, yellow
  flag iris, purple loosestrife, Japanese knotweed, shiny geranium, old manu2019s
  beard, slenderflower thistle, knapweeds, Armenian blackberry, and watch species
  such as garlic mustard and Italian arum. Most of this search will be conducted in
  areas which have never been searched comprehensively by foot and canoe including
  difficult access areas. Volunteers will search and control species such as ivy and
  holly mechanically and yellow flag iris by licensed herbicide application as encountered.
  Most of the project ($5,700 or 65%) will be spent in July-Sept 2015. The remaining
  $3,300 (35%) will be spent in FY 16 during the dormant season for optimal efficacy
  searching in woodland and forest for ivy and shiny geranium.\",\n\t\"license_title\":
